import { Container, Grid, Hidden, Paper, Typography } from '@mui/material';
import React from 'react'

import {
    BrowserRouter as Router,
    Route,
    Routes
} from "react-router-dom";

import ProfileImage from '../Assests/profile.png'
import { styled } from '@mui/material/styles';

import Cover from '../Assests/cover.avif';

import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';

const ProfilePhotoWrap = styled('img')(() => ({
    width: 150,
    height: 150,
    borderRadius: '100%',
    overflow: 'hidden',
    marginRight: 20,
    borderWidth: 7,
    borderColor: '#FFF',
    borderStyle: 'solid'
}))

const CustomizedPaper = styled(Paper)(({ theme }) => ({
    borderRadius: 15,
    height: 300,
    overflow: 'hidden',
    display: 'flex',
    alignItems: 'center',
    [theme.breakpoints.down('sm')]: {
        display: 'none'
    }
}))

const DetailsContainer = styled(Container)(({ theme }) => ({
    marginTop: -60,
    width: 'fit-content',
    [theme.breakpoints.down('sm')]: {
        marginTop: 50
    }
}))

export default function Profile() {
    return (
        <Container fixed>
            <CustomizedPaper elevation="24">
                <img src={Cover} width='100%' alt='Cover photo' />
            </CustomizedPaper>
            <Container sx={{
                display: 'flex',
                justifyContent: 'center',
                width: '100%'
            }} fixed >
                <DetailsContainer>
                    <ProfilePhotoWrap src={ProfileImage} alt='Prifile picture' />
                    <Typography fontWeight={700} variant='h4'>Username</Typography>
                    <Typography fontWeight={500} variant='body1'>#WalletNumber</Typography>
                </DetailsContainer>
            </Container>
            <Routes>
                <Route index element={<Activity/>} />
            </Routes>
        </Container >
    )
}

const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
        backgroundColor: theme.palette.common.black,
        color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
        fontSize: 14,
    },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
    // '&:nth-of-type(odd)': {
    //     backgroundColor: theme.palette.action.hover,
    // },
    // // hide last border
    // '&:last-child td, &:last-child th': {
    //     border: 0,
    // },
}));

function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
}

const rows = [
    createData('Heroes of Parallel', 159, 6.0, 24, 4.0),
    createData('Winesed Elder', 237, 9.0, 37, 4.3),
    createData('Heroes of Parallel', 262, 16.0, 24, 6.0),
    createData('Test NFT ', 305, 3.7, 67, 4.3),
    createData('Heroes of Parallel', 356, 16.0, 49, 3.9),
];

export function Activity() {
    return (
        <TableContainer component={Paper}>
            <Table sx={{ minWidth: 700 }} aria-label="customized table">
                <TableHead>
                    <TableRow>
                        <StyledTableCell>Item</StyledTableCell>
                        <StyledTableCell align="right">Price&nbsp;(ETH)</StyledTableCell>
                        <StyledTableCell align="right">Qty</StyledTableCell>
                        <StyledTableCell align="right">From</StyledTableCell>
                        <StyledTableCell align="right">To</StyledTableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {rows.map((row) => (
                        <StyledTableRow key={row.name}>
                            <StyledTableCell component="th" scope="row">
                                {row.name}
                            </StyledTableCell>
                            <StyledTableCell align="right">{row.calories}</StyledTableCell>
                            <StyledTableCell align="right">{row.fat}</StyledTableCell>
                            <StyledTableCell align="right">{row.carbs}</StyledTableCell>
                            <StyledTableCell align="right">{row.protein}</StyledTableCell>
                        </StyledTableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    )
}
